import 'dart:convert';
import 'package:flutter/foundation.dart';
import 'package:furnizone/Data/APIs/End_Ponits.dart';


class ProfileModel {
  String defimage =
      '';
  String? fullName;
  String? email;
  String? phone;
  Uint8List? profilePicture;

  ProfileModel({this.fullName, this.email, this.phone, this.profilePicture});

  ProfileModel.fromJson(Map<String, dynamic> json) {
    fullName = json[ApiKey.fullName];
    email = json[ApiKey.email];
    phone = json[ApiKey.phone];

    json[ApiKey.profilePicture] == '' || json[ApiKey.profilePicture] == null
        ? profilePicture = _decocdeBase64(defimage)
        : profilePicture = _decocdeBase64(json[ApiKey.profilePicture]);
  }

  Uint8List _decocdeBase64(String base64String) {
    return base64Decode(base64String);
  }
}
